// SPDX-License-Identifier: UNLICENCE
pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

contract PLC {
    event GrantRole(bytes32 indexed role, address indexed account);
    event RevokeRole(bytes32 indexed role, address indexed account);

    //role => account => true
    mapping(bytes32 => mapping(address => bool)) public roles;

    //0xa729ef4e25027bc652fc8b5c4d1d902947361fa7c8e7b4905e877823f27331b3
    bytes32 private constant Admin = keccak256(abi.encodePacked("Admin"));
    //0xcec9b8e63c868f2f7f30368f1583e7aa39ae80e163d57a859fa5a90244b28ac1
    bytes32 private constant Manufacturer =
        keccak256(abi.encodePacked("Manufacturer"));
    // 0xa19d0db335544d3c3ec35c34b9b35a51bd4861f7162de07d5af409611794db04
    bytes32 private constant Distributor =
        keccak256(abi.encodePacked("Distributor"));
    //0x1534e98f9dd33e3681193a0541f0c2e3d732d183dcdc630aac2b943280af42a0
    bytes32 private constant Retailer = keccak256(abi.encodePacked("Retailer"));
    //0x149c25a1aba1b21d5181b50679874a3340d23c071441bfbf39141562283e253c
    bytes32 private constant CustomerSupport =
        keccak256(abi.encodePacked("CustomerSupport"));
    //0xc0878b4b16a78e8085cba0ca02fc0924f1492924058d153153a3f286e0fd70ff
    bytes32 private constant Consumer = keccak256(abi.encodePacked("Consumer"));

    modifier onlyRole(bytes32 _role) {
        require(roles[_role][msg.sender], "not authorized");
        _;
    }
    modifier onlyBy(bytes32 _role) {
        require(roles[_role][msg.sender], "not authorized");
        _;
    }

    //manufacturer
    struct product {
        uint256 m_id;
        uint256 p_id;
        string product_name;
        string product_model_number;
        uint256 batch_id;
        string date_time;
        string address_manufacturer;
        string name_manufacturer;
    }
    mapping(uint256 => product) public prodDETAILS;
    event manufacturing(uint256 indexed m_Id);
    uint256 prodCount;
    //distributor
    struct dis {
        uint256 d_id;
        string dis_name;
        string address_dis;
        uint256 prod_id;
        string date_time;
    }
    mapping(uint256 => dis) public distributor;
    event distributing(uint256 indexed d_Id);
    uint256 distributorCount;
    //retailer
    struct retail {
        uint256 re_id;
        string r_name;
        string address_r;
        uint256 prod_id;
        string date_time;
        string sold_status;
    }
    mapping(uint256 => retail) public Retail;
    event retailing(uint256 indexed re_Id);
    uint256 retailerCount;
    //servicecenter
    struct service {
        uint256 se_id;
        uint256 prod_id;
        string defect_part;
        uint256 defect_rate;
        string location;
        string date_time;
    }
    mapping(uint256 => service) public ServiceCenter;
    event servicing(uint256 indexed se_Id);
    uint256 sCount;
    //customer
    struct customer {
        uint256 cus_id;
        string email;
        uint256 prod_id;
        uint256 ratings;
        string date_time;
    }
    mapping(uint256 => customer) public Customer;
    event Purchasing(uint256 indexed c_Id);
    uint256 CustomerCount;

    constructor() {
        _grantRole(Admin, msg.sender);
        prodCount = 0;
        distributorCount = 0;
        retailerCount = 0;
        sCount = 0;
        CustomerCount = 0;
    }

    function _grantRole(bytes32 _role, address _account) internal {
        roles[_role][_account] = true;
        emit GrantRole(_role, _account);
    }

    function grantRole(bytes32 _role, address _account)
        external
        onlyRole(Admin)
    {
        _grantRole(_role, _account);
    }

    function addproduct(
        uint256 _p_id,
        string memory _product_name,
        string memory _product_model_number,
        uint256 _batch_id,
        string memory _date_time,
        string memory _address_manufacturer,
        string memory _name_manufacturer
    ) external onlyBy(Manufacturer) {
        prodDETAILS[prodCount] = product(
            prodCount,
            _p_id,
            _product_name,
            _product_model_number,
            _batch_id,
            _date_time,
            _address_manufacturer,
            _name_manufacturer
        );
        prodCount++;
    }

    function add_distributordetails(
        string memory _dis_name,
        string memory _address_dis,
        uint256 _prod_id,
        string memory _date_time
    ) external onlyBy(Distributor) {
        distributor[distributorCount] = dis(
            distributorCount,
            _dis_name,
            _address_dis,
            _prod_id,
            _date_time
        );
        distributorCount++;
    }

    function add_retailerdetails(
        string memory _r_name,
        string memory _address_r,
        uint256 _prod_id,
        string memory _date_time,
        string memory _sold_status
    ) external onlyBy(Retailer) {
        Retail[retailerCount] = retail(
            retailerCount,
            _r_name,
            _address_r,
            _prod_id,
            _date_time,
            _sold_status
        );
        retailerCount++;
    }

    function add_SCdetails(
        uint256 _prod_id,
        string memory _defect_part,
        uint256 _defect_rate,
        string memory _location,
        string memory _date_time
    ) external onlyBy(CustomerSupport) {
        ServiceCenter[sCount] = service(
            sCount,
            _prod_id,
            _defect_part,
            _defect_rate,
            _location,
            _date_time
        );
        sCount++;
    }

    function cus_details(
        string memory _email,
        uint256 _prod_id,
        uint256 _ratings,
        string memory _date_time
    ) external onlyBy(Consumer) {
        Customer[CustomerCount] = customer(
            CustomerCount,
            _email,
            _prod_id,
            _ratings,
            _date_time
        );
        CustomerCount++;
    }

    function getManufacturerDetails(uint256 _prodId)
        public
        view
        returns (product memory)
    {
        return prodDETAILS[_prodId];
    }

    function getDistributorDetails(uint256 _disId)
        public
        view
        returns (dis memory)
    {
        return distributor[_disId];
    }

    function getRetailerDetails(uint256 _rId)
        public
        view
        returns (retail memory)
    {
        return Retail[_rId];
    }

    function getServiceCenterDetails(uint256 _sId)
        public
        view
        returns (service memory)
    {
        return ServiceCenter[_sId];
    }

    function getCustomerDetails(uint256 _cId)
        public
        view
        returns (customer memory)
    {
        return Customer[_cId];
    }
}
